import React from 'react';
import { Container, Box, Tabs, Tab } from '@material-ui/core';
import Main from './Main';
import Apps from './Apps';
import Policy from './Policy';

export class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value: "Coderals",
      pageComponent: {}
    }
  }

  handleChange(event, newValue){
    if(newValue === "Apps")
      this.setState({value:newValue});
    else {
      this.setState({value:newValue});
    }
  }

  render() {
    const pageName = this.state.value;
    let renderPage;
    if (pageName === "Apps") {
      renderPage = <Apps/>;
    }else if (pageName === "Policy") {
      renderPage = <Policy/>;
    }else {
      renderPage = <Main/>;
    }

    return (
      <Box>
        <Box
        color="#eceff1"
        bgcolor="#263238"
        paddingTop="2%">
          <Tabs
          centered
          value={this.state.value}
          onChange={this.handleChange.bind(this)}>
            <Tab label="Coderals" value="Coderals"/>
            <Tab label="Apps" value="Apps"/>
            <Tab label="Privacy Policy" value="Policy"/>
          </Tabs>
        </Box>
        <Box
        >
          {renderPage}
        </Box>
      </Box>
    );
  }
}
